[ #40ansRERC ]
 
Traverser 40 ans, c'est à la fois peu et beaucoup à l'échelle de l'histoire du transport ferroviaire.
@clemchap 📷 a exploré le territoire traversé par @RERC_SNCF et expose son travail ce soir et jusqu'à la fin de l'année en gare #Transilien d'Invalides [LIEN]

🚂🚃🚃 Très heureuse de revenir en gare aujourd'hui pour vous renseigner après une dizaine de jours à jongler entre école et révisions. 📖

Belle matinée à tous malgré le temps automnale. ☔🍂

@lignesNetU_SNCF @RERC_SNCF @RemiTrainPCLM #sncf [LIEN]

J'adore monter dans une cabine et découvrir que des personnes y ont accédées, fumées un pet et vidées un extincteur !
Bravo franchement... 
@RERC_SNCF [LIEN]

